import React from 'react';
import { NavLink } from 'react-router-dom';



const Sidebar = (props) => {
    return (
        <nav className="sidebar">
            <div className="sidebar-user">
                <h4>Utilisateur</h4>
                <hr />
                <NavLink to="/app/employe">Acceuil</NavLink>
                <NavLink to="/app/conges">List Congés </NavLink>
            </div>
            <hr style={MyStyle.hr}/>
           <div className="sidebar-admin">
                <h4>Administrateur</h4>
                <NavLink to="/app/employesAdmin">Page Employé </NavLink>
                <NavLink to="/app/congesAdmin">Listes des Congés </NavLink>
                <NavLink to="/app/divisionsAdmin">Divisions</NavLink>
           </div>
        </nav>
    )
}

export default Sidebar;
